import React, { Component } from 'react';
import './App.css';
import Notifications from './components/Notifications'
class App extends Component {

  state ={
    Notifications: [
      {id: 1,
      text: "asdasd",},
      {},
      {},
      {},
    ]
  }
  render() {
    return (
      <div className="App">
        
      </div>
    );
  }
}

export default App;
